import React from "react";
import DraggableBoldWrapper from "../../../assets/wrappers/BannerCreator/DraggableBoldWrapper";
import { BiBold } from "react-icons/bi";

const DraggableBold = () => {
  return (
    <DraggableBoldWrapper style={{ marginLeft: "1rem" }}>
      <button>
        <BiBold />
      </button>
    </DraggableBoldWrapper>
  );
};

export default DraggableBold;
